import React, { useState, useEffect } from "react";

interface PropertyCardProps {
  title: string;
  subtitle: string;
  description: string;
  images: string[];
  link: string;
}

const PropertyCard: React.FC<PropertyCardProps> = ({
  title,
  subtitle,
  description,
  images,
  link,
}) => {
  const [currentIndex, setCurrentIndex] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) => (prevIndex + 1) % images.length);
    }, 5000);
    return () => clearInterval(interval);
  }, [images.length]);

  const nextImage = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % images.length);
  };

  const prevImage = () => {
    setCurrentIndex(
      (prevIndex) => (prevIndex - 1 + images.length) % images.length
    );
  };

  return (
    <div style={styles.container}>
      {/* Image principale */}
      <div style={styles.leftColumn}>
        <img
          src={
            images[0] ||
            "https://via.placeholder.com/400x400?text=Image+Principale"
          }
          alt="Main"
          style={styles.mainImage}
        />
      </div>

      {/* Colonne droite */}
      <div style={styles.rightColumn}>
        {/* Miniatures */}
        <div style={styles.carouselWrapper}>
          <button onClick={prevImage} style={styles.arrowButton}>
            <span style={styles.arrowIcon}>{"<"}</span>
          </button>

          <img
            src={
              images[(currentIndex + 1) % images.length] ||
              "https://via.placeholder.com/286x286?text=Miniature+1"
            }
            alt="Mini 1"
            style={styles.miniature}
          />

          <img
            src={
              images[(currentIndex + 2) % images.length] ||
              "https://via.placeholder.com/286x286?text=Miniature+2"
            }
            alt="Mini 2"
            style={styles.miniature}
          />

          <button onClick={nextImage} style={styles.arrowButton}>
            <span style={styles.arrowIcon}>{">"}</span>
          </button>
        </div>

        {/* Texte */}
        <div style={styles.textBlock}>
          <h2 style={styles.title}>{title}</h2>
          <h3 style={styles.subtitle}>{subtitle}</h3>
          <p style={styles.description}>{description}</p>
          <a href={link} style={styles.button}>
            Descobriu
          </a>
        </div>
      </div>
    </div>
  );
};

const styles: { [key: string]: React.CSSProperties } = {
  container: {
    display: "flex",
    maxHeight: "450px",
    gap: "2rem",
    marginBottom: "3rem",
  },
  leftColumn: {
    flex: 1,
  },
  rightColumn: {
    flex: 1,
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-between",
  },
  mainImage: {
    width: "100%",
    aspectRatio: "1 / 1",
    borderRadius: "10px",
    objectFit: "cover",
  },
  carouselWrapper: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    gap: "0.5rem",
    height: "50%",
    position: "relative",
  },
  miniature: {
    width: "calc(50% - 0.25rem)",
    aspectRatio: "1 / 1",
    objectFit: "cover",
    borderRadius: "10px",
  },
  arrowButton: {
    position: "absolute",
    top: "50%",
    transform: "translateY(-50%)",
    backgroundColor: "#c59d6b",
    borderRadius: "50%",
    padding: "6px",
    border: "none",
    cursor: "pointer",
    zIndex: 2,
  },
  arrowIcon: {
    color: "white",
    fontSize: "1rem",
    fontWeight: "bold",
    mixBlendMode: "screen",
  },
  textBlock: {
    textAlign: "center",
    padding: "1rem",
  },
  title: {
    fontSize: "1.5rem",
    fontWeight: "bold",
    color: "#fff",
  },
  subtitle: {
    fontSize: "1.1rem",
    color: "#ccc",
  },
  description: {
    color: "#eee",
    margin: "0.5rem 0",
  },
  button: {
    backgroundColor: "#c59d6b",
    color: "white",
    padding: "0.6rem 1.2rem",
    borderRadius: "30px",
    textDecoration: "none",
    display: "inline-block",
  },
};

export default PropertyCard;
